[general] Properties.doesPropertyExist()
parameters: Parameter Type Description <code>property</code> String A property to check
description: <p>Checks whether a given property exists in preferences.</p>
example: <p>Check whether labels with indices 10 and 99 exist in preferences:</p> <pre><code>var property = 'BE.Prefs.LabelNames.10';
var exists = app.properties.doesPropertyExist(property);
alert('Property "' + property + '" exists: ' + exists.toString());

property = 'BE.Prefs.LabelNames.99';
exists = app.properties.doesPropertyExist(property);
alert('Property "' + property + '" exists: ' + exists.toString());
</code></pre>
returns: <p>Boolean.</p>
details: <p><code>app.properties.doesPropertyExist(property)</code></p>

[general] Properties.getProperty()
parameters: Parameter Type Description <code>property</code> String A property to get a value for
description: <p>Returns a property value.</p>
example: <p>Get label name at a given index:</p> <pre><code>var labelIndex = 0;
var property = 'BE.Prefs.LabelNames.' + labelIndex;

if (app.properties.doesPropertyExist(property)) {
    alert(app.properties.getProperty(property));
