[sequence] Sequence.autoReframeSequence()
parameters: <p>Parameter</p> <p>Type</p> <p>Description</p> <p><code>numerator</code></p> <p>Integer</p> <p>Numerator of desired frame aspect ratio.</p> <p><code>denominator</code></p> <p>Integer</p> <p>Denominator of desired frame aspect ratio.</p> <p><code>motionPreset</code></p> <p>String</p> <p>One of:</p> <ul> <li><code>slower</code></li> <li><code>default</code></li> <li><code>faster</code></li> </ul> <p><code>newName</code></p> <p>String</p> <p>A name for a newly created sequence.</p> <p><code>useNestedSequences</code></p> <p>Boolean</p> <p>Whether to honor nested sequence.</p>
description: <p>Generates a new, auto-reframed sequence.</p>
example: <pre><code>var sequence = app.project.activeSequence;
if (sequence) {
    var numerator = 1;
    var denominator = 1;
    var motionPreset = 'default'; // 'default', 'faster', 'slower'
    var newName = sequence.name + ', auto-reframed.';
    var useNestedSequences  = false;

    var newSequence = sequence.autoReframeSequence(numerator, denominator, motionPreset, newName, useNestedSequences);

    if (newSequence) {
        alert('Created reframed sequence: ' + newName + '.');
    } else {
        alert('Failed to create re-framed sequence: ' + newName + '.');
    }
} else {
    alert('No active sequence');
}
</code></pre>
returns: <p>The new Sequence object.</p>
details: <p><code>app.project.sequences[index].autoReframeSequence(numerator, denominator, motionPreset, newName, useNestedSequences)</code></p>

[sequence] Sequence.createSubsequence()
parameters: Parameter Type Description <code>ignoreTrackTargeting</code> Boolean Whether the new sequence should ignore the track targeting, in the original sequence. Optional, default is <code>false</code>
description: <p>Creates a new sequence, from the in point to the out point, which is a sub-sequence of the original sequence.</p>
example: <pre><code>function nestSelection() {
    var activeSequence = app.project.activeSequence;
    var selection = activeSequence.getSelection();

    if (!selection.length) {
        return;
    }

    var trackId = selection[0].parentTrackIndex;
    var originalInPoint = activeSequence.getInPointAsTime();
    var originalOutPoint = activeSequence.getOutPointAsTime();
    var start = selection[0].start;
    var end = selection[selection.length - 1].end;
    activeSequence.setInPoint(start.seconds);
    activeSequence.setOutPoint(end.seconds);

    var nestedSequence = activeSequence.createSubsequence(true);

    activeSequence.videoTracks[trackId].overwriteClip(nestedSequence.projectItem, start.seconds);
    activeSequence.setInPoint(originalInPoint.seconds);
    activeSequence.setOutPoint(originalOutPoint.seconds);

    return nestedSequence;
}
</code></pre>
returns: <p>Returns the newly-created Sequence object.</p> <p>Note</p> <p>This is not the same as nesting. The newly-created sequence is not inserted back into the original sequence. To nest, see the example function below.</p>
details: <p><code>app.project.sequences[index].createSubsequence([ignoreTrackTargeting])</code></p>
